import styled from "styled-components";

export const TheOriginalSixStyle = styled.div`
  .icons_box {
    height: 100vh;

    position: absolute;
    top: 0;
    left: 50%;

    div {
      display: grid;
      grid-template-columns: 2fr 2fr 3fr;
      grid-template-rows: 5rem;

      position: relative;
      left: -50%;
      padding-top: 20rem;
    }
  }

  .icons_img {
    width: 3rem;
    height: 3rem;
  }
`;
